import React, { useState } from 'react';
import '../styles/Footer.css';

const Footer = () => {
  const [email, setEmail] = useState('');
  const [formState, setFormState] = useState({ submitting: false, success: false, error: false });

  const handleSubmit = async (e) => {
    e.preventDefault();
    setFormState({ submitting: true, success: false, error: false });

    try {
      const response = await fetch('https://formspree.io/f/xdkzdoka', { // <-- PASTE YOUR URL HERE
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email }),
      });

      if (response.ok) {
        setFormState({ submitting: false, success: true, error: false });
        setEmail('');
      } else {
        throw new Error('Failed to submit form');
      }
    } catch (error) {
      console.error('Form submission error:', error);
      setFormState({ submitting: false, success: false, error: true });
    }
  };


  return (
    <footer id="SITE_FOOTER" className="site-footer">
      <div className="footer-content">
        <div className="footer-nav">
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/services">Services</a></li>
            <li><a href="/testimonials">Testimonials</a></li>
            <li><a href="/gallery">Gallery</a></li>
          </ul>
        </div>
      </div>
      <div className="footer-bottom">
        <p className="copyright">
          Â© {new Date().getFullYear()} RDS Events. All rights reserved.
        </p>
      </div>
    </footer>
  );
};

export default Footer;
